The probability that a person did not finish the race is equal to the number of people who did not finish divided by the total number of people.
Since there are 1000 people registered for the race, the probability that the selected person did not finish is $\frac{1000-100}{1000} = \boxed{\frac{900}{1000}}$.
The answer is: \frac{900}{1000}

